// src/components/Sidebar.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <NavLink to="/" exact="true" activeclassname="active">Home</NavLink>
      <NavLink to="/patients" activeclassname="active">Patients</NavLink>
      <NavLink to="/appointments" activeclassname="active">Appointment</NavLink>
      <NavLink to="/stock" activeclassname="active">Stock</NavLink>
      <NavLink to="/finance" activeclassname="active">Finance</NavLink>
    </div>
  );
};

export default Sidebar;
